import React from "react";
import "./../styles/Home.css";

export default function Home() {
  return (
    <section id="home" className="home-section">
      <div className="headline-container glass">
        <h1 className="gradient-text animate__animated animate__fadeInDown">
          Hi, I'm <span className="name">Your Name</span>
        </h1>
        <p className="subtitle animate__animated animate__fadeInUp">
          Modern Web Developer | Creative Coder | UI Enthusiast
        </p>
      </div>
    </section>
  );
}
